def aaho_office_details(office_id):
    try:
        office_id = int(office_id)
        office = get_or_none(AahoOffice, id=office_id) or default_office()
    except ValueError:
        office = None

    if not office:
        return '', ''

    office = office.to_json()
    address = '%s, %s-%s' % (office['address'], office['city'], office['pin'])
    phone = office['phone']
    return address, phone


def default_office():
    try:
        return AahoOffice.objects.select_related('branch', 'branch__state').filter(branch__name='Raipur')[0]
    except IndexError:
        return None


